#include "./map.hpp"
void generateMap(){
    for (int i=0;i<width;i++){
        for (int j=0;j<height;j++){
            ::map[i][j] = 0;
            if ((float)rand()/(float)RAND_MAX > 0.75){
                ::map[i][j] = 1;
            }
        }
    }
}


struct coordinates { int pos[2];};

class AStar{
    public:
    coordinates path[width*height];
    int pathLength = 0;
    coordinates neighbours[8];
struct node {
    vector<coordinates> path; //Path Taken
    int pos[2];
    double f=0,g=0; // Cost from Start, Cost to End
};

double manhattenDistance(int x1,int y1,int x2,int y2){
    //linear movement - no diagonals - just cardinal directions (NSEW)
    return abs(x1 - x2) + abs(y1 - y2);
}
double elucidianDistance(int x1,int y1,int x2,int y2){
    return sqrt(pow(x1 - x2,2) + pow(y1 - y2,2));
}
double costFunction(coordinates Point, coordinates Goal){
    return elucidianDistance(Point.pos[0], Point.pos[1], Goal.pos[0], Goal.pos[1]);
}

bool canWalkHere(int x,int y){
    return (::map[x][y] ==0); //Walkable Tile Value
}
void Neighbours(int x,int y){
    int North = y-1,
    South = y+1,
    East = x+1,
    West = x-1;
    bool NorthConnected = false,
    SouthConnected = false,
    EastConnected = false,
    WestConnected = false;
    if (North>-1){if (canWalkHere(x,North)){NorthConnected = true;}}
    if (South<height){if (canWalkHere(x,South)){SouthConnected = true;}}
    if (East<width){if (canWalkHere(East,y)){EastConnected = true;}}
    if (West>-1){if (canWalkHere(West, y)){WestConnected =  true;}}

    for (int i=0;i<8;i++){
        neighbours[i] = {-1,-1};
    }
    if (NorthConnected){
        neighbours[0] = {x,North};}
    if (SouthConnected){
        neighbours[1] = {x,South};}
    if (EastConnected){
        neighbours[2] = {East,y};}
    if (WestConnected){
        neighbours[3] = {West,y};}
    //For Diagonal movement

   if(NorthConnected){
        if(EastConnected && canWalkHere(East, North))
        neighbours[4] = {East,North};
        if(WestConnected && canWalkHere(West, North))
        neighbours[5] = {West,North};
    }
    if(SouthConnected){
        if(EastConnected && canWalkHere(East, South))
        neighbours[6] = {East, South};
        if(WestConnected && canWalkHere(West, South))
        neighbours[7] = {West, South};
    }
}

vector<coordinates> calculatePath(coordinates start, coordinates end){

    bool visited[width][height]; //Visited Nodes
    coordinates parent[width][height];
    int gscores[width][height];

    for (int i=0;i<width;i++){
        for (int j=0;j<height;j++){
            visited[i][j] = false;
            parent[i][j] = {-1,-1};
            gscores[i][j] = width*height;
        }
    }
    // create Nodes from Start and End x, y coordintes
    node pathStart;
    pathStart.pos[0] = start.pos[0];
    pathStart.pos[1] = start.pos[1];
    pathStart.g = costFunction(start, end);

	vector <coordinates> result;


    gscores[start.pos[0]][start.pos[1]]=0;

	vector<node> Open;
    Open.push_back(pathStart); //Possible Paths

    int max, min;
    while (!Open.empty()){
        max = width*height;  //Max Cost
        min = 0; //Minimum Cost
        for (int i=0; i<(int)Open.size();i++){
            if (Open[i].f < max){ // If there is a smaller cost from start
                max = Open[i].f;
                min = i;
            }
        }
        node myNode = Open[min];
        Open.erase(Open.begin() + min);

        if (myNode.pos[0] == end.pos[0] && myNode.pos[0] == end.pos[1]){
            myNode.path.push_back(end);
            return myNode.path;
            result = myNode.path;
        }
        else{ //not destination

            Neighbours(myNode.pos[0], myNode.pos[1]);

            for (int i=0;i<8;i++){
                if (neighbours[i].pos[0] == -1 || neighbours[i].pos[1] == -1)continue;

                node myPath;
                myPath.path = myNode.path;

                myPath.pos[0] = neighbours[i].pos[0];
                myPath.pos[1] = neighbours[i].pos[1];

                myPath.path.push_back({myNode.pos[0], myNode.pos[1]});

                parent[myPath.pos[0]][myPath.pos[1]].pos[0] = myNode.pos[0];
                parent[myPath.pos[0]][myPath.pos[1]].pos[1] = myNode.pos[1];

                if (!visited[myPath.pos[0]][myPath.pos[1]]){ //If not visited before
                    //estimated cost of this particular route so far
                    //gscores[myPath.pos[0]][myPath.pos[1]] = gscores[myNode.pos[0]][myNode.pos[1]] +
                    //                                        costFunction(neighbours[i], {myNode.pos[0],myNode.pos[1]});
                    myPath.g = myNode.g + costFunction(neighbours[i], {myNode.pos[0],myNode.pos[1]});
                    //estimated cost of this particular route so far
                    myPath.f = myPath.g + costFunction(neighbours[i], {end.pos[0],end.pos[1]});

                    Open.push_back(myPath);//Next Nodes to visit
                    //mark this node in the world graph as visited
                    visited[myPath.pos[0]][myPath.pos[1]] = true;

                }

            }
        }
    }
/*
    pathLength = 0;
    coordinates backtrack = end;
    path[pathLength].pos[0] = backtrack.pos[0];
    path[pathLength].pos[1] = backtrack.pos[1];
    pathLength++;
    for (int i=0; i<width*height; i++){
        if ( (backtrack.pos[0] == start.pos[0] && backtrack.pos[1] != start.pos[1]) ||
            (backtrack.pos[0] == -1) ){break;}
        backtrack = parent[backtrack.pos[0]][backtrack.pos[1]];
        path[pathLength].pos[0] = backtrack.pos[0];
        path[pathLength].pos[1] = backtrack.pos[1];
        pathLength++;
    }*/
    return result;

}

};

